/*global chrome*/
import React from "react";

class Test extends React.Component {
  constructor(props) {
    super(props);

    const arr = [];
    for (let i = 0; i < 100; i++) {
      arr.push(i);
    }
    this.state = {
      arr,
      position: 0
    };
  }

  componentDidMount() {
    this.timer = setInterval(() => this.tick(), 1000);
  }

  componentWillUnmount() {
    clearInterval(this.timer);
  }

  tick() {
    this.setState({
      position: this.state.position + 1
    });
  }

  render() {
    return <div>{this.state.arr[this.state.position]}</div>;
  }
}

export default Test;
